class Solution:
    def minimumSum(self, g: List[List[int]]) -> int:
        m,n=len(g),len(g[0])
        def cal(x1,y1,x2,y2):
            minx=inf
            maxx=-inf
            miny=inf
            maxy=-inf
            for i in range(x1,x2+1):
                for j in range(y1,y2+1):
                    if g[i][j]==1:
                        minx=min(minx,i)
                        maxx=max(maxx,i)
                        miny=min(miny,j)
                        maxy=max(maxy,j)
            dx=maxx-minx+1
            dy=maxy-miny+1
            return max(1,dx*dy)
        res=inf
        for y1 in range(0,n-1):
            for y2 in range(y1+1,n-1):
                res=min(res,cal(0,0,m-1,y1)+cal(0,y1+1,m-1,y2)+cal(0,y2+1,m-1,n-1))
        for x1 in range(0,m-1):
            for x2 in range(x1+1,m-1):
                res=min(res,cal(0,0,x1,n-1)+cal(x1+1,0,x2,n-1)+cal(x2+1,0,m-1,n-1))
        for x in range(0,m-1):
            for y in range(0,n-1):
                res=min(res,cal(0,0,x,y)+cal(0,y+1,x,n-1)+cal(x+1,0,m-1,n-1))
                res=min(res,cal(0,0,x,n-1)+cal(x+1,0,m-1,y)+cal(x+1,y+1,m-1,n-1))
        for y in range(0,n-1):
            for x in range(0,m-1):
                res=min(res,cal(0,0,x,y)+cal(0,y+1,m-1,n-1)+cal(x+1,0,m-1,y))
                res=min(res,cal(0,0,m-1,y)+cal(0,y+1,x,n-1)+cal(x+1,y+1,m-1,n-1))
        return res
